import './About.scss';
const About = () => {
    return (
        <div className='about-main'>
            <h2>About the Project</h2>
            <p>React</p>
            <p>Axios</p>
            <p>SCSS</p>
            <p>HTML</p>
            <p>Redux</p>
            <p>Redux Toolkit</p>
        </div>
    )
}

export default About;
